		<item>
			<title><![CDATA[Entbannungsantrag @Timo]]></title>
			<link><![CDATA[https://forum.dlrp.eu/forum/index.php?thread/11628-entbannungsantrag-timo/]]></link>
			<description><![CDATA[<ul><li><li>Hallo ich möchte mich schon im voraus für das lesen und Bearbeitung meines Entbannungs Antrag bedanken<br><u>wo wurdest du gebannt ?</u><br>Game Server<br><br><u>Wer hat dich gebannt ?</u><br>DLRP Timo<br><br><u>Für wie lange wurdest du gebannt ?</u><br>6Tage<br><u>Mit welchem Grund wurdest du gebannt ?</u><br>Wegen</li></li></ul>…]]></description>
			<pubDate>Sun, 16 Oct 2022 21:22:59 +0000</pubDate>
			<dc:creator><![CDATA[Hinata Carter]]></dc:creator>
			<guid><![CDATA[https://forum.dlrp.eu/forum/index.php?thread/11628-entbannungsantrag-timo/]]></guid>
						<content:encoded><![CDATA[<ul><li><li>Hallo ich möchte mich schon im voraus für das lesen und Bearbeitung meines Entbannungs Antrag bedanken<p><br></p><p><u>wo wurdest du gebannt ?</u></p><p>Game Server</p><p><br></p><p><u>Wer hat dich gebannt ?</u></p><p>DLRP Timo</p><p><br></p><p><u>Für wie lange wurdest du gebannt ?</u></p><p>6Tage</p><p><u>Mit welchem Grund wurdest du gebannt ?</u></p><p>Wegen nicht schützen meines Lebens</p><p><u>was ist vorgefallen ?</u></p><p><br></p><p>Am Mpowered wurde ich erschossen dann wurde ich vom Medic hochgehohlt jemand wollte das ich ins Auto einsteige aber ich habs nicht gemacht das ging so 2-3mal</p><p><br></p><p><u>Warum möchtest du entbannt werden ?</u></p><p>Es macht mir sehr viel spaß auf dem Server zu Spielen und mit freunden was zu zocken. Außerdem habe ich meine Lektion gelernt und werde in zukunft mein ic Leben schützen. Ebenfalls wurde mir gesagt dass ich nach 3Tagen einen antrag stellen soll und wieder entbannt werde.</p><p><br></p><p>Steamname:</p><p>Bigbot_EU_West57</p><p><br></p><p>Discordname:</p><p>bigBOT-EU-west#8931</p><p><br></p><p>Ich würde mich über eine vorzeitige entbannung freuen und hoffe auf eine Positive Nachricht</p></li></ul>]]></content:encoded>
						<slash:comments><![CDATA[0]]></slash:comments>
		</item>
